t-friendly. To celebrate the halfway mark for our 50 Days of $1,000 Scholarships Giveaway, THREE lucky winners have the chance to win a $1,000 scholarship from Ascent. For a chance to win today's $1,000 scholarship giveaway: \n\n1. Follow @AscentFunding on TikTok and Instagram and \u201cLike\u201d this Instagram post.\n2. Create a TikTok or Instagram Reel sharing your favorite things to do in the summer that are fun and budget-friendly.\n3. Visit the \u201cEnter Summer Scholarship\u201d link in our bio to complete your entry.\n\nThe deadline to apply for Ascent\u2019s $1,000 scholarship prize (3) is June 27, 2021 at 8:59AM PST. To apply and see official rules, visit the \u201cEnter Summer Scholarship\u201d link in our bio.\n\n#Budget #BudgetFriendly #BudgetTips #BudgettingTips #Budgetting  #ScholarshipHunter #ScholarshipHunt #ScholarshipFinder #CollegeHacks #CollegeLife #Scholarships #Scholarship #StudentAdvice #CollegeReady #StudentResources #AscentFunding #50DaysofScholarships #ad\n#AscentSponsored  #Bootcamp #TechBootcamp #UXDesign #DataScience #DataScientist #CodingBootcamp #WorkInTech #SoftwareEngineering #SoftwareEngineer #Bootcamps #TechBootcamps"}}]},"shortcode":"CfMax4LOzdk","edge_media_to_comment":{"count":0},"taken_at_timestamp":1656086618,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/289828276_1224729284965312_6472679082065539946_n.jpg?stp=dst-jpg_e35_s1080x1080\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=104\u0026_nc_ohc=GfyZaXpUP44AX9qsBtK\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-SuErIwGDsktfnM8uMm01V0TwpW30gbf-tSoBKxnd4wg\u0026oe=62BCF701\u0026_nc_sid=4efc9f","edge_liked_by":{"count":38},"edge_media_preview_like":{"count":38},"owner":{"id":"3936196066"},"thumbnail_src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/289828276_1224729284965312_6472679082065539946_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=104\