ud83c\udf1e\ud83c\udf1e\ud83c\udf1e\ud83c\udf1e\ud83c\udf1e\n\nKyros.ai is a one-stop College Prep Platform through membership, powered by AI technology. It offers product, instructed-led services (92 workshops), and an engaging online community, to help high school students prepare for college with ease and confidence.\n.\nKyros.ai \u662f\u4e00\u500b\u901a\u904e\u6703\u54e1\u5236\u7684\u4e00\u7ad9\u5f0f\u5927\u5b78\u9810\u79d1\u5e73\u53f0\uff0c\u7531\u4eba\u5de5\u667a\u80fd\u6280\u8853\u63d0\u4f9b\u652f\u6301\u3002\u5b83\u63d0\u4f9b\u7522\u54c1\u3001\u6307\u5c0e\u5f0f\u670d\u52d9\uff0892 \u500b\u7814\u8a0e\u6703\uff09\u548c\u4e00\u500b\u5f15\u4eba\u5165\u52dd\u7684\u5728\u7dda\u793e\u5340\uff0c\u4ee5\u5e6b\u52a9\u9ad8\u4e2d\u751f\u8f15\u9b06\u81ea\u4fe1\u5730\u70ba\u5927\u5b78\u505a\u597d\u6e96\u5099\u3002\n\n\ud83c\udf1e\ud83c\udf1e\ud83c\udf1e\ud83c\udf1e\ud83c\udf1e\n\n(Kyros.AI History)\n\nEdTech company in Silicon Valley founded by former Googlers\n\nStarted by former Googlers and top educators from Harvard \u0026 MIT in 2018, Kyros AI mission is to be the Virtual Counselor \u0026 the personalized GPS Guidance for high school students and families on their journey to dream colleges.\n\nKyros AI uses Big Data \u0026 Machine Learning to provide the largest knowledge repository, objective benchmark and profile-based recommendations, deriving insights from 350K+ Courses and Tests, 50,000+ sample essays, resumes and letters of recommendations, 3,000+ financial aid programs, and much more for high school students to find the best path.\n.\n(Kyros.AI \u6b77\u53f2)\n\n\u7531\u524d Google \u54e1\u5de5\u5275\u7acb\u7684\u77fd\u8c37 EdTech \u516c\u53f8\n\nKyros AI \u65bc 2018 \u5e74\u7531\u524d Google \u54e1\u5de5\u548c\u54c8\u4f5b\u548c\u9ebb\u7701\u7406\u5de5\u5b78\u9662\u7684\u9802\u5c16\u6559\u80b2\u5de5\u4f5c\u8005\u5275\u7acb\uff0c\u5176\u4f7f\u547d\u662f\u6210\u70ba\u9ad8\u4e2d\u751f\u548c\u5bb6\u5ead\u901a\u5f80\u5922\u60f3\u5927\u5b78\u7684\u865b\u64ec\u9867\u554f\u548c\u500b\u6027\u5316 GPS \u6307\u5c0e\u3002\n\nKyros AI \u4f7f\u7528\u5927\u6578\u64da\u548c\u6a5f\u5668\u5b78\u7fd2\u4f86\u63d0\u4f9b\u6700\u5927\u7684\u77e5\u8b58\u5eab\u3001\u5ba2\u89c0\u57fa\u6e96\u548c\u57fa\u65bc\u500b\u4eba\u8cc7\u6599\u7684\u63a8\u85a6\uff0c\u5f9e 350K+ \u8ab2\u7a0b\u548c\u6e2c\u8a66\u300150,000 \u591a\u7bc7\u6a23\u672c\u8ad6\u6587\u3001\u7c21\u6b77\u548c\u63a8\u85a6\u4fe1\u30013,000 \u591a\u500b\u7d93\u6fdf\u63f4\u52a9\u8a08\u5283\u7b49\u4e2d\u7372\u5f97\u898b\u89e3\u66f4\u591a\u7684\u662f\u70ba\u9ad8\u4e2d\u751f\u5c0b\u627e\u6700\u4f73\u8def\u5f91\u3002\n\n\ud83c\udf1e\ud83c\udf1e\ud83c\udf1e\ud83c\udf1e\ud83c\udf1e\n\nKyros AI \nNathalie Galindo \nElaine Xiang \n\n#collegeprep #collegeadmissions #cccollege #education #highschool #collegebound #testprep #sat #classof #satprep #actprep #tutoring #act #collegeapplications #collegelife #students #collegecounseling #highereducation #collegeready #admissions #collegeplanning #university #scholarships #collegeapps #collegeessay #studentsuccess #school\n #educators"}}]},"shortcode":"CfMY1SdhV1q","edge_media_to_comment":{"count":0},"taken_at_timestamp":1656085594,"dimensions":{"height":1350,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289643535_364626469074774_4833402543404756662_n.jpg?stp=dst-jpg_e35_p1080x1080\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=WoG0ol5J6u4AX_LEa-K\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT92_HT9_fYDKxYdq7EqiStBMkcdRfuIM3pmln9D--x91A\u0026oe=62BCA384\u0026_nc_sid=4efc9f","edge_liked_by":{"count":6},"edge_media_preview_like":{"count":6},"owner":{"id":"196779506"},"thumbnail_src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289643535_364626469074774_4833402543404756662_n.jpg?stp=c0.180.1440.1440a_dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=WoG0ol5J6u4AX_LEa-K\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-JsQiZ_l7PYLF-bvB3yiv