ly received 5 offer letters for those who passed their interviews. We have also secured a June 30th interview date for 6 persons from in our Special Service.\n\nThe first batch are just two references away from their COS! The second batch are midway - we will begin intense interview preparations today to ensure that we better our 83.3% interview success record. \ud83d\udcaf\n\nYesterday, our partner gave CareerEdu 5 new special slots. They are almost gone. Note that to benefit from our special slots you need to be enrolled in our Care Job Pathway Service. It comes at some extra costs which is fully refundable if you don't pass the interview (unlikely given our intense preparations). Our regular pathway is also yielding pretty decent result as well. The only catch is that it is not guaranteed, given how competitive the pathway has become.\n\nTo subscribe to our Care Job Pathway Service, Pay N50k to CareerEdu Consulting 8227832794 Sterling Bank. Send proof of payment to our Admin Christabel on +2347031335401.\n\nI am excited for these ones whose UK \ud83c\uddec\ud83c\udde7 dreams are coming true before their very eyes. I speak with their excited partners and I am glad we could make their relocation goals happen.\n\nWe are committed to your success! \ud83d\ude4f\u2764\ufe0f\n\n#CareerEdu #jobs #opportunities #scholarships #AlaAfrica"}}]},"shortcode":"CfMP2p7MpkV","edge_media_to_comment":{"count":0},"taken_at_timestamp":1656080886,"dimensions":{"height":1350,"width":1080},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/289633509_838591943781988_6338873966331564357_n.webp?stp=dst-jpg_e35\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=104\u0026_nc_ohc=EH0oj908s8cAX-Opjqx\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_T5j5tqfIL3q5hC1jME6VPaGi9JkZxWXXlynb4SsLwKA\u0026oe=62BCF559\u0026_nc_sid=4efc9f","edge_liked_by":{"count":4},"edge_media_preview_like":{"count":-1},"owner":{"id":"461249243"},"thumbnail_src":"https://instagram.flos1-2.fna.fbc