re will always be manuscripts to write and experiments to do, and it's important to make time for opportunities as they come along. The timing is never right!\n\nI put my lab work on pause, delegated what I could and contacted my referees with last-minute requests (10/10 do not recommend!!). And the moment I committed to this application it stopped looking like such an impossible task. I ended up submitting the application just in time and have absolutely no regrets. \n\nThe time that you spend thinking about your research (and career in general) is never  time wasted. It\u2019s nice when it pays off in the form of an award/grant/fellowship, but even when it doesn\u2019t you have likely learned a ton, gained valuable experience and reminded yourself why you chose to pursue your career.\n\nI might not get this fellowship, but I am proud that I tried.\n\n#ScientistsOfInstagram #ResearchLife #Postdoc #PostdocLife #PhDLife #GradLife #Scholarships #BeBrazen #BrazenCreator"}}]},"shortcode":"CfG4wo3IxIM","edge_media_to_comment":{"count":22},"taken_at_timestamp":1655901006,"dimensions":{"height":1349,"width":1080},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/289448545_765391871442344_7057127032185606837_n.jpg?stp=dst-jpg_e15_fr_p1080x1080\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=kDQdn9F56kgAX8n2OKu\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8d_2hb1WkKfljFVOxOvYVE0CR87HI_0k_4fzOXiip3kQ\u0026oe=62BC3FA2\u0026_nc_sid=4efc9f","edge_liked_by":{"count":1132},"edge_media_preview_like":{"count":1132},"owner":{"id":"4849824503"},"thumbnail_src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/289448545_765391871442344_7057127032185606837_n.jpg?stp=c0.134.1080.1080a_dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=kDQdn9F56kgAX8n2OKu\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-IRBSH_YrBACiimsndMnVugWxl3Ey-tYjoLbokmtbC_Q\u0026oe=62BC3FA2\u0026_nc_sid=4efc9f","t