:false,"accessibility_caption":null}},{"node":{"__typename":"GraphImage","id":"2867149392344762124","edge_media_to_caption":{"edges":[{"node":{"text":"More than 40 Ukrainian refugee children are able to attend camps with the Dana Point Ocean Institute this summer, thanks to scholarships from a recent fundraiser. \n*\nEvery year, the Institute hosts multiple weeklong summer camps for children between the ages of 5 and 17. After the Ukrainian crisis struck, the institute raised money through student scholarship programs, which are funded by the community and corporate sponsors, to share these opportunities with refugee families. \n*\nOriginally, the idea emerged after Laguna Beach resident Susie Campbell, who had taken in a Ukrainian woman and her son, reached out to the institute to inquire about summer opportunities.\n*\nThe programs are currently at maximum capacity, though the Ocean Institute will add more Ukrainian children if positions become available.\n*\nRegistration for campers and other information regarding the programs can be found at the Ocean Institute\u2019s website, oceaninstitute.org/summer-camp/.\n*\nVisit danapointtimes.com for more information. \n\n#danapoint\n#marineeducation\n#oceaninstitute \n#orangecounty\n#scholarships\n#summercamp\n#ukraine\n#ukrainianchildren\n#ukrainianrefugees"}}]},"shortcode":"CfKKS54r8cM","edge_media_to_comment":{"count":4},"taken_at_timestamp":1656010867,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/289657806_550311480053911_4832251197504349374_n.jpg?stp=dst-jpg_e35\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=107\u0026_nc_ohc=BH505mQR-a8AX-7GgHi\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8r-IWk7XjBlEv0k209l7nMYv_Y8pXQ4jBpS00K4iJEPA\u0026oe=62BD46C7\u0026_nc_sid=4efc9f","edge_liked_by":{"count":297},"edge_media_preview_like":{"count":297},"owner":{"id":"181140173"},"thumbnail_src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/289